import React, { useState, useEffect } from 'react';
import '../App.css';

function Expenses() {
  const [expenses, setExpenses] = useState([]);
  const [newExpense, setNewExpense] = useState({ description: '', amount: '' });
  const [total, setTotal] = useState(0);

  useEffect(() => {
    // Load expenses from local storage on initial load
    const storedExpenses = JSON.parse(localStorage.getItem('expenses')) || [];
    setExpenses(storedExpenses);
    calculateTotal(storedExpenses);
  }, []);

  useEffect(() => {
    // Save expenses to local storage whenever they change
    localStorage.setItem('expenses', JSON.stringify(expenses));
    calculateTotal(expenses);
  }, [expenses]);

  const calculateTotal = (expList) => {
    const sum = expList.reduce((acc, exp) => acc + parseFloat(exp.amount || 0), 0);
    setTotal(sum.toFixed(2));
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setNewExpense({ ...newExpense, [name]: value });
  };

  const handleAddExpense = () => {
    if (newExpense.description && newExpense.amount) {
      setExpenses([...expenses, { ...newExpense, id: Date.now(), date: new Date().toLocaleDateString() }]);
      setNewExpense({ description: '', amount: '' });
    }
  };

  const handleDeleteExpense = (id) => {
    setExpenses(expenses.filter(exp => exp.id !== id));
  };

  return (
    <div className="expenses-container">
      <h2>Expense Tracker</h2>
      <div className="add-expense">
        <input
          type="text"
          name="description"
          value={newExpense.description}
          onChange={handleInputChange}
          placeholder="Description"
        />
        <input
          type="number"
          name="amount"
          value={newExpense.amount}
          onChange={handleInputChange}
          placeholder="Amount ($)"
          step="0.01"
        />
        <button onClick={handleAddExpense}>Add Expense</button>
      </div>
      <div className="expenses-list">
        {expenses.length > 0 ? (
          <table>
            <thead>
              <tr>
                <th>Date</th>
                <th>Description</th>
                <th>Amount ($)</th>
                <th>Action</th>
              </tr>
            </thead>
            <tbody>
              {expenses.map(exp => (
                <tr key={exp.id}>
                  <td>{exp.date}</td>
                  <td>{exp.description}</td>
                  <td>{exp.amount}</td>
                  <td>
                    <button className="delete-btn" onClick={() => handleDeleteExpense(exp.id)}>Delete</button>
                  </td>
                </tr>
              ))}
            </tbody>
            <tfoot>
              <tr>
                <td colSpan="2"><strong>Total</strong></td>
                <td><strong>${total}</strong></td>
                <td></td>
              </tr>
            </tfoot>
          </table>
        ) : (
          <p>No expenses recorded yet.</p>
        )}
      </div>
    </div>
  );
}

export default Expenses;
